	def scf(self,title,scf_loc='',volume='',temperature=0,density='mole/cc',burn='no',options='',library='03c'):
		
		# This method prints a serpent composition file, scf
		# options
		# 	title:       this is the title of the material
		#	scf_loc:     this is file location 
		#		if this is left blank -- '' -- then the scf will not be printed
		#	volume:      this is the volume in cm
		# 	temperature: this is the temperatures in Kelvin
		#	density:     this is the units of the composition vector
		#		mole/cc
		#		at/bn-cm
		#		if this is a number, this will be the normalization factor
		#	burn:        this indicates when this is a burnable materials or not
		#	options:     this is a string to add additional options in the scf
		#	library:     this is the cross section library (ie. XXc in ZZAAAM.XXc)

		if str(density)[0] == 'M' or str(density)[0] == 'm':
			multiplier = 1.
		elif str(density)[0] == 'A' or str(density)[0] == 'a':
			multiplier = (1./.602213129)
		else:
			multiplier = density/self.mass()

		self.mat_card = '\nmat ' + title + ' '
		
		self.mat_card += '-%1.5E ' % (self.mass()*multiplier)

		if volume != '':
			self.mat_card += 'vol %1.5E ' % volume

		if temperature != 0:
			self.mat_card += 'tmp %1.5E ' % temperature

		if burn == 'yes' or burn == '1':
			self.mat_card += 'burn 1 '

		if options != '':
			self.mat_card += options
		
		for nucl in self.comp.keys():
			Z = nucl[:-4]

			if len(Z) < 2:
				Z = ' ' + Z

			if Z in [' 6','23']:
				A = '000'
			else:
				A = nucl[-4:-1]

			M = nucl[-1]

			if M == '1':
				#this isotope is metastable
				#update the A
				A = '3' + A[1:]

			self.mat_card += '\n%s%s.%s %1.5E' % (Z,A,library,self.comp[nucl])

		self.mat_card += '\n'
		if scf_loc != '':
			open(scf_loc,'w').write(self.mat_card)

	def kcf(self,mat_num,title='',kcf_loc='',temperature=0,density='mole/cc'):

		# This method prints a serpent composition file, scf
		# options
		#   mat_num:     this is the material number
		#   title:       this is the title of the material
		#   scf_loc:     this is file location 
		#       if this is left blank -- '' -- then the scf will not be printed
		#   temperature: this is the temperatures in Kelvin
		#   density:     this is the units of the composition vector
		#       mole/cc
		#       at/bn-cm
		#       if this is a number, this will be the normalization factor
	
		if str(density)[0] == 'M' or str(density)[0] == 'm':
			multiplier = (1/.602213129)
		elif str(density)[0] == 'A' or str(density)[0] == 'a':	
			multiplier = (.602213129)
		else:
			multiplier = density/self.mass()*(.602213129)

		# convert mat_num into an int
		mat_num = int(mat_num)

		if title == '':
			title = 'material %d' % mat_num
		
		self.mat_card = '\n\'' + title + ' '
		
		ZtoSymbol = {1: 'h', 2: 'he', 3: 'li', 4: 'be', 5: 'b', 6: 'c', 7: 'n', 8: 'o', 9: 'f', 10: 'ne', 11: 'na', 12: 'mg', 13: 'al', 14: 'si', 15: 'p', 16: 's', 17: 'cl', 18: 'ar', 19: 'k', 20: 'ca', 21: 'sc', 22: 'ti', 23: 'v', 24: 'cr', 25: 'mn', 26: 'fe', 27: 'co', 28: 'ni', 29: 'cu', 30: 'zn', 31: 'ga', 32: 'ge', 33: 'as', 34: 'se', 35: 'br', 36: 'kr', 37: 'rb', 38: 'sr', 39: 'y', 40: 'zr', 41: 'nb', 42: 'mo', 43: 'tc', 44: 'ru', 45: 'rh', 46: 'pd', 47: 'ag', 48: 'cd', 49: 'in', 50: 'sn', 51: 'sb', 52: 'te ', 53: 'i', 54: 'xe', 55: 'cs', 56: 'ba', 57: 'la', 58: 'ce', 59: 'pr', 60: 'nd', 61: 'pm', 62: 'sm', 63: 'eu', 64: 'gd', 65: 'tb', 66: 'dy', 67: 'ho', 68: 'er', 69: 'tm', 70: 'yb', 71: 'lu', 72: 'hf', 73: 'ta', 74: 'w', 75: 're', 76: 'os', 77: 'ir', 78: 'pt', 79: 'au', 80: 'hg', 81: 'tl', 82: 'pb', 83: 'bi', 84: 'po', 85: 'at', 86: 'rn', 87: 'fr', 88: 'ra', 89: 'ac', 90: 'th', 91: 'pa', 92: 'u', 93: 'np', 94: 'pu', 95: 'am', 96: 'cm', 97: 'bk', 98: 'cf', 99: 'es', 100: 'fm'}	

		for nucl in self.comp.keys():
			Z = int(nucl[:-4])
			A = int(nucl[-4:-1])
			M = nucl[-1]
			
			if Z in [6,8]:
				isotope = ZtoSymbol[Z]
			else:
				isotope = ZtoSymbol[Z] + '-' + str(A)

			self.mat_card += '\n  %s %d 0 %1.5E %1.5E end' % (isotope, mat_num, (self.comp[nucl]*multiplier), temperature)	
		
		self.mat_card += '\n'
		if kcf_loc != '':
			open(kcf_loc,'w').write(self.mat_card)


