			skele += '\n INP    1   -2  -1  -1  1  1'
			skele += '\n BUP'
			skele += '\n _MODE_      _TIME1_   _POWER0_    1   2   4   2'
			skele += '\n _MODE_      _TIME2_   _POWER1_    2   3   4   0'
