			skele += '\n _MODE_      _TIME6_   _POWER5_    6   7   4   0'
			skele += '\n _MODE_      _TIME7_   _POWER6_    7   8   4   0'
			skele += '\n _MODE_      _TIME8_   _POWER7_    8   9   4   0'
			skele += '\n _MODE_      _TIME9_   _POWER8_    9   10   4   0'
			skele += '\n _MODE_      _TIME10_   _POWER9_   10   11   4   0'
			skele += '\n BUP'
